How to Send Images as Attachments with Mailgun and Node.js?<p>I am attempting to send images as attachments to emails but I am having trouble figuring out how to accomplish this.</p>

<p>I am using Mailgun to send the mail, Cloudinary to upload the images, MongoDB as my database, and Node.js/Express as my backend.</p>

<p>The user process goes like this:</p>

<ul>
<li>User submits pictures onto the site</li>
<li>Pictures are uploaded via Cloudinary and the direct link to each image is saved in the MongoDB database</li>
<li>Mail goes out via Mailgun to inform users of the new post with links to the images in the body</li>
</ul>

<p>Obviously this is not ideal because you need to click on each link individually to see and download the images. I would like to attach them directly to the email so the user has an easier time downloading the images.</p>

<p>I have looked at the documentation for Mailgun but it doesn't seem like non-local images can be sent as attachments. Is there something I'm missing?</p>

<p>I have tried using the 'inline' and 'attachment' parameters for Mailgun but I end up with an error message stating the file/directory cannot be located.</p>

<pre><code>var pictures = [];
        post.images.forEach(function(photos){
            pictures.push(photos + " ");
            return pictures;
        });

var attch = new mailgun.Attachment({data: pictures[0], filename: "picture"});
        var data = {
            from: "email &lt;email@email.com&gt;",
            to: "email@email.com",
            subject: 'this is an email',
            html: 'here is a new post and here are the images in that post',
            attachment: attch
        };
</code></pre>

<p>The expected result is an email with the attached images of the new post, or in this case a single image from that post.</p>

<p>The actual result is this error message:</p>

<pre><code>events.js:183
  throw er; // Unhandled 'error' event
  ^

Error: ENOENT: no such file or directory, stat 'https://res.cloudinary.com/user/image/upload/image.jpg '
</code></pre>

